import React, { useState } from 'react';
import { useHistory } from 'react-router-dom';
import { useApiRequest } from './useApiRequest'; // Import the general API request hook
import SuccessMessage from './SuccessMessage'; // Import the SuccessMessage component
import FailedMessage from './FailedMessage'; // Import the FailedMessage component

function LoginPage() {
    const history = useHistory();
    const { isLoading, data, error, makeRequest } = useApiRequest(); // Initialize the hook
    const [formData, setFormData] = useState({
        email: '',
        password: '',
    });
    const [loginSuccess, setLoginSuccess] = useState(null);

    const handleFormSubmit = async (e) => {
        e.preventDefault();

        try {
            // Make a POST request to the login endpoint
            await makeRequest('http://localhost:3000/api/auth/login', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(formData),
            });

            if (!error) {
                // Login successful
                setLoginSuccess(true);
                console.log('Login successful');

                // Redirect to the home page after a successful login with a 2-second delay
                setTimeout(() => {
                    history.push('/home');
                }, 2000);
            } else {
                // Login failed
                setLoginSuccess(false);
                console.error('Login failed');
            }
        } catch (error) {
            console.error('Error:', error);
            setLoginSuccess(false);
        }
    };

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    return (
        <div className="login-container" style={{ backgroundImage: `url(${process.env.PUBLIC_URL}/map.png)` }}>
            <div className="login-form">
                <h2 className="form-title">Login</h2>
                {loginSuccess === true && (
                    <SuccessMessage message="Login successful!" />
                )}
                {loginSuccess === false && (
                    <FailedMessage message="Login failed. Please try again." />
                )}
                <form onSubmit={handleFormSubmit}>
                    <div className="form-group">
                        <label htmlFor="email">Email</label>
                        <input
                            type="email"
                            id="email"
                            name="email"
                            value={formData.email}
                            onChange={handleInputChange}
                            required
                            className="input-field"
                        />
                    </div>
                    <div className="form-group">
                        <label htmlFor="password">Password</label>
                        <input
                            type="password"
                            id="password"
                            name="password"
                            value={formData.password}
                            onChange={handleInputChange}
                            required
                            className="input-field"
                        />
                    </div>
                    <div className="forgot-password-link">
                        <a href="/forgot-password" className="forgot-password-text">
                            Forgot Password?
                        </a>
                    </div>
                    <button type="submit" className="submit-button" disabled={isLoading}>
                        {isLoading ? 'Logging in...' : 'Login'}
                    </button>
                </form>
                <p className="login-link">
                    Don't have an account? <a href="/signup" className="signup-link">Signup</a>
                </p>
            </div>
        </div>
    );
}

export default LoginPage;
